import{_ as a,o as i,c as o,ag as r}from"./chunks/framework.DEqXEGcv.js";const t="/screenshots/OCCP1010.png",q=JSON.parse('{"title":"입주처리","description":"","frontmatter":{},"headers":[],"relativePath":"occp/move-in.md","filePath":"occp/move-in.md","lastUpdated":null}'),e={name:"occp/move-in.md"};function n(s,l,h,u,c,d){return i(),o("div",null,[...l[0]||(l[0]=[r('<h1 id="입주처리" tabindex="-1">입주처리 <a class="header-anchor" href="#입주처리" aria-label="Permalink to &quot;입주처리&quot;">​</a></h1><blockquote><p><strong>메뉴 경로</strong>: 입주자 &gt; 입주처리</p></blockquote><h2 id="개요" tabindex="-1">개요 <a class="header-anchor" href="#개요" aria-label="Permalink to &quot;개요&quot;">​</a></h2><p>신규 입주자(소유자 또는 임차인)의 정보를 등록하고 입주 처리를 수행합니다. 입주등록 후 동호에 배치된 입주자 정보를 관리하고, 소유주 변동, 출입카드 발급, 관리비 예치금(선수금) 등의 관련 업무를 처리합니다.</p><hr><h2 id="입주등록" tabindex="-1">입주등록 <a class="header-anchor" href="#입주등록" aria-label="Permalink to &quot;입주등록&quot;">​</a></h2><p><img src="'+t+'" alt="입주등록 화면"></p><h3 id="기능-설명" tabindex="-1">기능 설명 <a class="header-anchor" href="#기능-설명" aria-label="Permalink to &quot;기능 설명&quot;">​</a></h3><ul><li>검색 조건을 설정하여 동호를 조회한 뒤 입주 처리를 할 수 있습니다.</li><li>입주등록화면에서 조회 후 입력된 동호에 비어있는 세대 정보를 확인하고, 입주자 정보를 신규 등록할 수 있습니다.</li></ul><h3 id="입주-등록-절차" tabindex="-1">입주 등록 절차 <a class="header-anchor" href="#입주-등록-절차" aria-label="Permalink to &quot;입주 등록 절차&quot;">​</a></h3><ol><li><strong>동호 조회</strong>: 검색 조건(동, 호, 상태 등)을 설정하여 목록을 조회합니다.</li><li><strong>세대 선택</strong>: 조회된 목록에서 입주 처리할 동호를 선택 후 수정 버튼을 클릭하면 상세화면으로 이동합니다.</li><li><strong>기본 정보 입력</strong>: <ul><li><strong>(1) 직업/일반</strong>: 클릭하여 세대 기본 구분을 입력합니다.</li><li><strong>(2) 탭 기능</strong>: 탭을 클릭하면 해당 세대의 정보를 볼 수 있으며, 입력된 내용이 없을 경우 해당 정보를 찾기가 어렵습니다. 세대주가 기입되어 있는 경우는 찾기가 가능합니다.</li></ul></li><li><strong>동호 변경</strong>: 동호찾기 기능을 통해 다른 호수로도 이동 가능합니다.</li><li><strong>구성원 입력</strong>: <ul><li>공주/세대주 추가: 구성원을 입력 및 등록할 수 있습니다.</li><li>자동차 등록: 해당세대의 차량정보를 등록 및 입력합니다.</li><li>반려동물: 반려동물 정보를 등록 및 입력합니다.</li><li>민간임대(거주): 민간임대 전용을 전화번호를 입력합니다.</li></ul></li><li><strong>세대주/소유주 동일 여부 확인</strong>: 세대주와 소유주가 동일하지 않을 경우 세대주 정보와 소유주 정보를 별도로 입력하고, 세대주 정보를 수정한 후 자진 변동 처리를 통해 일괄 적용합니다.</li><li><strong>예시자입표 탭 확인</strong>: 예시지입표를 V 체크하면 상태에서 원하는 날짜로 입력하면 해당 날짜에 선택된 정보가 나타납니다. 조회 수정 버튼에서 상세 세부등록을 조회 및 수정할 수 있습니다.</li></ol><h3 id="엑셀-일괄-등록-엑셀자료올리기" tabindex="-1">엑셀 일괄 등록 (엑셀자료올리기) <a class="header-anchor" href="#엑셀-일괄-등록-엑셀자료올리기" aria-label="Permalink to &quot;엑셀 일괄 등록 (엑셀자료올리기)&quot;">​</a></h3><ul><li>대입력 필요 동시 처리 시 엑셀자료올리기로 등록이 가능합니다.</li><li>샘플다운로드 하여 등록 양식 및 취소사항 확인 후 업로드할 수 있습니다.</li><li>엑셀 파일을 업로드하면 목록에 반영된 후 일괄 저장 버튼을 통해 확정합니다.</li></ul><blockquote><p><strong>주의사항</strong>: 입주 처리 시 이전 세대주의 전출 처리가 선행되어야 합니다. 개인정보 수집/이용 동의를 반드시 확인하세요.</p></blockquote><hr><h2 id="소유주변동처리" tabindex="-1">소유주변동처리 <a class="header-anchor" href="#소유주변동처리" aria-label="Permalink to &quot;소유주변동처리&quot;">​</a></h2><h3 id="기능-설명-1" tabindex="-1">기능 설명 <a class="header-anchor" href="#기능-설명-1" aria-label="Permalink to &quot;기능 설명&quot;">​</a></h3><p>소유주 정보를 입력 및 변경하여 관리하는 메뉴입니다.</p><h3 id="사용-방법" tabindex="-1">사용 방법 <a class="header-anchor" href="#사용-방법" aria-label="Permalink to &quot;사용 방법&quot;">​</a></h3><ol><li><strong>조회</strong>: 입력 및 수정할 동호를 선택 후 변경 전 이전까지의 변경을 클릭합니다.</li><li><strong>정보 수정</strong>: 소유주 정보를 자세히 보여지는 페이지로 변경됩니다. <ul><li>소유주 정보 및 사업장 정보를 변경 후 저장하면 자동으로 소유주 정보가 수정됩니다.</li></ul></li><li><strong>저장</strong>: 소유주 정보 변경 완료 후 저장합니다.</li></ol><blockquote><p><strong>참고</strong>: 소유주 정보 및 사업장 정보를 변경 후 저장하면 자동으로 소유주 수정이 반영됩니다.</p></blockquote><hr><h2 id="출입카드발급등록" tabindex="-1">출입카드발급등록 <a class="header-anchor" href="#출입카드발급등록" aria-label="Permalink to &quot;출입카드발급등록&quot;">​</a></h2><h3 id="기능-설명-2" tabindex="-1">기능 설명 <a class="header-anchor" href="#기능-설명-2" aria-label="Permalink to &quot;기능 설명&quot;">​</a></h3><p>공동현관 및 공용카드키 등의 발급 현황을 관리합니다.</p><ul><li>잠재 전세의 동후, 조회기간 · 발급일자이력를 확인하고 잊혀진 동/호를 선택하여 세대별 발급 현황을 관리합니다.</li><li>발급기간 목록을 올 오른쪽 엑셀다운 버튼을 통해 목록을 다운로드 받은 후 보관할 수 있습니다.</li><li><strong>발급일자가 지나거나 이미 등록된 카드는 발급자의 인적사항이 없습니다.</strong></li></ul><h3 id="카드-발급-절차" tabindex="-1">카드 발급 절차 <a class="header-anchor" href="#카드-발급-절차" aria-label="Permalink to &quot;카드 발급 절차&quot;">​</a></h3><ol><li>조회 조건(동/호, 기간 등) 설정 후 조회합니다.</li><li>발급할 세대를 선택합니다.</li><li>카드 발급 정보를 입력하고 저장합니다.</li><li>발급 현황 목록을 엑셀로 다운로드하여 보관합니다.</li></ol><hr><h2 id="관리비예치금-선수관리" tabindex="-1">관리비예치금(선수관리) <a class="header-anchor" href="#관리비예치금-선수관리" aria-label="Permalink to &quot;관리비예치금(선수관리)&quot;">​</a></h2><h3 id="기능-설명-3" tabindex="-1">기능 설명 <a class="header-anchor" href="#기능-설명-3" aria-label="Permalink to &quot;기능 설명&quot;">​</a></h3><p>입주 시 입주자에게 부과한 관리비예치금(선수관리)에 대한 수납과 이납을 등록하고 조회할 수 있습니다.</p><ul><li>예치금 금액 등록 및 수납금액 수납/납부 처리를 할 수 있습니다.</li></ul><h3 id="예치금-조회-및-관리" tabindex="-1">예치금 조회 및 관리 <a class="header-anchor" href="#예치금-조회-및-관리" aria-label="Permalink to &quot;예치금 조회 및 관리&quot;">​</a></h3><ol><li><strong>조회</strong>: 납부 구분 및 납부기간으로 조회할 수 있습니다.</li><li><strong>양식 출력</strong>: 양식을 선택하여 인쇄 및 출력할 수 있습니다. 총 4가지 출력 양식 중 선택하여 사용합니다: <ul><li><strong>관리비예치금납부고지서</strong> (₩400,000)</li><li><strong>관리비예치금납부서</strong> (₩400,000)</li><li><strong>관리비예치금영수증서</strong> (₩400,000)</li><li><strong>관리비예치금반환확인서</strong> 등</li></ul></li></ol><blockquote><p><strong>참고</strong>: 부그룹 관리의 목록 관리 입력으로 금액 이변경이 가능하며, 결과지 반환임기간이 되면 자동임기간이 동기화됩니다.</p></blockquote><h3 id="엑셀-일괄-등록" tabindex="-1">엑셀 일괄 등록 <a class="header-anchor" href="#엑셀-일괄-등록" aria-label="Permalink to &quot;엑셀 일괄 등록&quot;">​</a></h3><ul><li>데이터 일괄 등록 시 엑셀자료올리기로 등록이 가능합니다.</li><li>엑셀자료 올리기 버튼을 클릭하면 업로드 창이 나타납니다.</li><li>샘플다운로드 버튼으로 양식을 다운로드하여 입력완료 후 업로드합니다.</li></ul><hr><h2 id="관련-메뉴" tabindex="-1">관련 메뉴 <a class="header-anchor" href="#관련-메뉴" aria-label="Permalink to &quot;관련 메뉴&quot;">​</a></h2><ul><li><a href="/occp/move-out.html">전출처리</a> - 전출 처리 및 장기수선충당금 정산</li><li><a href="/occp/vehicle.html">차량관리</a> - 입주 후 차량 등록</li><li><a href="/occp/inquiry.html">조회관리</a> - 입주자 정보 조회</li></ul><h2 id="주의사항" tabindex="-1">주의사항 <a class="header-anchor" href="#주의사항" aria-label="Permalink to &quot;주의사항&quot;">​</a></h2><ul><li>입주 처리 시 이전 세대주의 전출 처리가 선행되어야 합니다.</li><li>개인정보 수집/이용 동의를 확인하세요.</li><li>소유주변동 시 관련 서류를 반드시 확인하세요.</li><li>출입카드 발급 시 발급일자가 지난 카드는 인적사항이 표시되지 않으므로 주의하세요.</li></ul>',43)])])}const b=a(e,[["render",n]]);export{q as __pageData,b as default};
